import React, {useEffect} from "react";
import { Container } from "react-bootstrap";

const UserList = () => {
    return (
        <Container className="mt-5">
            <h3 className="text-center bg-danger text-white">
                Danh sách người dùng
            </h3>
        </Container>
    );
};

export default UserList;
